export default function Severity({ severity}) {
    let COLORS = {
      1: ['#efcb57', 'Baixa'],
      2: ['#ef8c57', 'Média'],
      3: ['#ef5757', 'Alta'],
      4: ['#161308', 'COE']
    }

    try {
      return (
        <div className='alert-severity' style={{ 'backgroundColor': COLORS[severity][0] }}>{COLORS[severity][1]}</div>
      )
    }
    catch {
      return (
        ""
      )
    }

  }
